syntax = "proto3";

package proto;

service test {
    rpc complete(Message) returns (Empty);
}

message Message {
    message Repeated {
        string value = 1;
    }

    message Nested {
        string value = 1;
    }
    
    string message = 1;
    repeated Repeated repeating = 2;
    Nested nested = 3;
    repeated string repeating_values = 4;
}

message Empty {
}